<!DOCTYPE html>
<html lang="en">
<head>
    <title>List | QuiteMuffin</title>
    <link rel="stylesheet" href="./Style/LNP.css">
    <script src="./Scripts/Index.js"></script>
</head>
<body>
    <div id="gatsby">
        <div id="gatsby-focus-wrapper" style="outline:none" tabindex="-1">
            <div class="ms-Fabric">
                <main role="main">
                    <div class="raised main-content-block">
                        <img src="./Style/Image/logo.png" onclick="logo_onCLick()" class="logo" style="padding-left: 200px;">
                        <h1 class="gatsby-title">Life Cylce</h1>
                        <p>List names that have been archived. Remember what the legend said once? It's evolving, just backwards.
                            If you remember my old name, <span class="spoiler-text">you're cool.</span>
                        </p>
                        
    <table>
        <tr>
            <th>Name</th>
            <th>Changed On</th>
            <th>Status</th>
        </tr>
        <tr>
            <td>Nomex</td>
            <td>2020</td>
            <td>NO</td>
        </tr>
        <tr>
            <td>Ren</td>
            <td>2021</td>
            <td>In-Use</td>
        </tr>
        <tr>
            <td>QuiteMuffin</td>
            <td>2022</td>
            <td>CURRENT</td>
        </tr>
    </table>
                    </div>

                </main>
            </div>
        </div>
    </div>
</body>
</html>
